import './scss/style.scss';

import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import Content from './components/Content/Content';


function App() {
  return (
    <div className="App">
      <div className="container">
        <Header />
        <Navbar />
        <Content />
      </div>
    </div>
  );
}


export default App;
